import React from "react";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import { connect } from "react-redux";
import { add, remove } from "../../store/actions/add";
const Form = () => {
  return (
    <div>
      <form>
        <TextField></TextField>
        <Button
          onClick={() => this.props.onStoreResult}
          style={{ color: "black" }}
        >
          送信
        </Button>
      </form>
      <ul>
        {this.props.add.map((l) => (
          <li key={l.id}>{l.value}</li>
        ))}
      </ul>
    </div>
  );
};
const mapStateToProps = (state) => {
  return {
    add: state.add
  };
};

const mapDisptchToProps = (dispatch) => {
  return {
    onStoreResult: () => dispatch(add.storeResult()),
    onDeleteResult: (id) => dispatch(remove.deleteResult(id))
  };
};

export default connect(mapStateToProps, mapDisptchToProps)(Form);
